import anime from "animejs/lib/anime.es.js";
import React from "react";

const Animation = () => {
  let morphing = anime({
    targets: ".morph",
    d: [
      {
        value: "M 70.710678,404.03551 258.59905,63.6141 424.26407,392.92383 Z"
      },
      {
        value: "M 70.710678,404.03551 415.17269,299.9898 l 9.09138,92.93403 z"
      }
    ],
    easing: "easyInOutQuint",
    duration: 1400,
    autoplay: true
  });
  morphing.restart();
  return (
    <svg
      width="500px"
      height="500px"
      viewBox="0 0 500 500"
      preserveAspectRatio="none"
    >
      <path
        className="morph"
        d="M 32.324883,27.24861 H 473.76156 V 470.70558 H 32.324883 Z"
      ></path>
    </svg>
  );
};

export default Animation;
